import React from 'react';

const Project = ({ title, description, imageSrc, link, githubLink }) => {
  return (
    <div className="project">
      <a href={link} target="_blank" rel="noopener noreferrer">
        <h2>{title}</h2>
        <img src={process.env.PUBLIC_URL +"../../public/img/"+imageSrc} alt="image of my project"/>
        {description && <p>{description}</p>}
        Lancer le projet
      </a>
        <br/>
        <br/>
      <a href={githubLink} target="_blank" rel="noopener noreferrer">Lien du repo Github</a>
    </div>
  );
};

export default Project;
